import React from 'react'

function ArticleCard({ article }) {

    return (

        <div className="ArticleCardWrapper">
            <div className="ArticleCardImage">
                <img src={article.image.url} alt={article.image.alt} />
            </div>
            <div className="ArticleCardText">
                <h2 className="ArticleCardTitle">
                    {article.title}
                </h2>
                <p className="ArticleCardDate">{console.log(article.publishedDate.toLocaleDateString("en-US", { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' }
                ))}</p>
                <p className="ArticleCardBlurb">{article.blurb}</p>
                <p className="ArticleCardLink"><a href={"article/" + article.id}>Read More</a></p>
            </div>
        </div>
    );
}

export default ArticleCard;
